import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import ProjectList from "./components/ProjectList/ProjectList";
import "./App.scss";

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

export default function App() {
	return (
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/">Nos Voyages</Link>
          </li>
          <li>
            <Link to="/index">Index</Link>
          </li>
          <li>
            <Link to="/nous">nous</Link>
          </li>
        </ul>

        <Switch>
          <Route path="/index">
            <index />
          </Route>
          <Route path="/nous">
            <nous />
          </Route>
          <Route path="/">
			<ProjectList className="App"/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
